INSERT INTO `sys_oper_log` VALUES ('819', '工作任务', '1', 'com.ruoyi.web.controller.worktask.WorkTaskController.addSave()', '1', 'admin', '研发部门', '/worktask/workTask/add', '127.0.0.1', '内网IP', '{\r\n  \"pid\" : [ \"\" ],\r\n  \"workName\" : [ \"光网质量提升2.0--- 构建高质量智能连接\" ],\r\n  \"rateProgress\" : [ \"0\" ],\r\n  \"leadDeptId\" : [ \"115\" ],\r\n  \"cooperateDeptId\" : [ \"117\" ],\r\n  \"workScore\" : [ \"\" ],\r\n  \"openQuestion\" : [ \"\" ],\r\n  \"workType\" : [ \"1\" ],\r\n  \"workStatus\" : [ \"1\" ],\r\n  \"description\" : [ \"打造高速率精品光网，奠定智能宽带基础，确保客户感知更优及能力行业绝对领先；\\r\\n强化端到端承载能力，深化家庭连接智慧化，提升智能宽带体验。\\r\\n重点工作目标值：\\r\\n1、直连和经一级级联至BAS的OLT占比≥95%；\\r\\n2、2000户以上OLT、汇聚交换机双物理上联完成率100%；\\r\\n3、OLT超限链路占比≤2%；\\r\\n4、存量用户光衰达标率≥98%，新装用户光衰达标率100%；\\r\\n5、OLT设备月度脱网率≤2%；\\r\\n6、接入网现场资源准确率≥95%；\\r\\n7、天翼网关存量终端匹配率≥95%，新装终端匹配率100%；\\r\\n8、互联网业务质量综合得分≥95分；\\r\\n9、宽带接入速率感知优良率≥92%；\\r\\n10、天翼网关主流终端软件版本统一率≥90%；\\r\\n11、光端客户资源树完整率≥99%；   \" ],\r\n  \"remark\" : [ \"\" ],\r\n  \"leaderId\" : [ \"1\" ],\r\n  \"file\" : [ \"undefined\" ]\r\n}', '0', null, '2019-03-27 03:41:58');
INSERT INTO `sys_oper_log` VALUES ('820', '工作任务', '1', 'com.ruoyi.web.controller.worktask.WorkTaskController.addSave()', '1', 'admin', '研发部门', '/worktask/workTask/add', '127.0.0.1', '内网IP', '{\r\n  \"pid\" : [ \"\" ],\r\n  \"workName\" : [ \"天翼高清端到端运营能力提升\" ],\r\n  \"rateProgress\" : [ \"0\" ],\r\n  \"leadDeptId\" : [ \"115\" ],\r\n  \"cooperateDeptId\" : [ \"117\" ],\r\n  \"workScore\" : [ \"\" ],\r\n  \"openQuestion\" : [ \"\" ],\r\n  \"workType\" : [ \"1\" ],\r\n  \"workStatus\" : [ \"1\" ],\r\n  \"description\" : [ \"支撑省公司、分公司电视业务“高质量”发展，在直播、点播两大基础上，扩展业务生态圈结构，以智能化、精准化、便捷化、效率化为目标，从业务、平台、承载网络、终端四位一体开展优化提升，持续巩固电视业务质量和口碑。\\r\\n1、（天翼高清感知优良率≥95%（忙时）、直播切换1s内成功率≥95%；点播3s内加载成功率≥95%；开机认证成功率≥99%\\r\\n2、主流智能机顶盒版本统一率≥90%；\\r\\n3、增量部署集团探针，使总规模达到60万以上\\r\\n4、支撑智慧家庭应用推广和天翼高清内容运营，创新应用和内容，提升业务吸引力。\" ],\r\n  \"remark\" : [ \"\" ],\r\n  \"leaderId\" : [ \"1\" ],\r\n  \"file\" : [ \"undefined\" ]\r\n}', '0', null, '2019-03-27 03:44:17');
INSERT INTO `sys_oper_log` VALUES ('821', '工作任务', '1', 'com.ruoyi.web.controller.worktask.WorkTaskController.addSave()', '1', 'admin', '研发部门', '/worktask/workTask/add', '127.0.0.1', '内网IP', '{\r\n  \"pid\" : [ \"\" ],\r\n  \"workName\" : [ \"深化光网质量提升，确保光宽电视运营用户感知\" ],\r\n  \"rateProgress\" : [ \"0\" ],\r\n  \"leadDeptId\" : [ \"115\" ],\r\n  \"cooperateDeptId\" : [ \"117\" ],\r\n  \"workScore\" : [ \"\" ],\r\n  \"openQuestion\" : [ \"\" ],\r\n  \"workType\" : [ \"1\" ],\r\n  \"workStatus\" : [ \"1\" ],\r\n  \"description\" : [ \" 落实 “事先化、主动化、自动化”工作要求，支撑公司宽带和电视业务发展、聚焦用户感知、稳固宽带网络“高品质、成体系、固优势”的目标，保持光网品质优势。\\r\\n一、业务\\r\\n1.宽带接入速率感知优良率≥92%；互联网访问丢包率指标领先，时延与友商可比。\\r\\n2.天翼高清感知优良率≥95%（忙时）、直播切换1s内成功率≥95%；点播3s内加载成功率≥95%；开机认证成功率≥99%。\\r\\n3.互联网业务质量综合得分>95分，具体包括工信部互联网性能监测与分析平台服务器在线率、工信部信息通信网络运行质量通报中的网内质量得分、家庭网关和互联网质量测试探针测试所得质量得分分别大于95分。\\r\\n二、网络\\r\\n4.光衰达标率≥98% ，OLT脱网率≤2%，高负荷链路占比≤2%。\\r\\n5.客户健康档案数据完整率≥99%，客户资源树数据准确率≥99%\\r\\n6.家庭网关零配置业务开通成功率≥97%\\r\\n7.主流天翼网关版本统一率≥90%\\r\\n8.在天翼高清端到端业务质量探针部署量基础上，增量部署探针，使总规模达到60万以上。\\r\\n9.光接入网远程集中配置占比>=80%；光接入网省远程处理完好率>=30%\\r\\n三、客户感知\\r\\n10.NPS继续保持领先，31省全\" ],\r\n  \"remark\" : [ \"\" ],\r\n  \"leaderId\" : [ \"1\" ],\r\n  \"file\" : [ \"undefined\" ]\r\n}', '0', null, '2019-03-27 03:45:39');
