INSERT INTO `sys_oper_log` VALUES ('872', '专项工作汇报内容', '2', 'com.ruoyi.web.controller.worktask.WorkTaskActivityController.editSave()', '1', '15693120282', '研发部门', '/worktask/workTaskActivity/edit', '127.0.0.1', '内网IP', '{\r\n  \"id\" : [ \"644b5b2ab96c4879b561e9613685330a\", \"a5630a9d83da4bb38583f4a4fb0e80de\", \"be81c07d6e7c4fb8a3b2a24188a7d699\", \"e9c8b5c7e98c45ceb2ad29099cb87fe0\", \"3ee587d741b84377a30920e521fb9662\", \"81d080c1bc3a442182cac41e09fd0962\", \"7ce49ea43d7f4e8c8e5bcb887606648e\", \"1e51aad290924cfab5bfcc7135cab0ae\", \"6a0e7f17f38f4588af336dacad1ca61e\", \"560a524b1ad5421bb25ac6e4e22f34c6\" ],\r\n  \"target\" : [ \"1.互联网业务质量综合得分与周边省份可比\\r\\n2.完成ITMS系统建设前期准备工作\\r\\n3.光宽端到端新增六项能力基本完成20%\\r\\n\", \"1.互联网业务质量综合得分与周边省份可比，并有所提升。\\r\\n2.确定接入网集约化实施方案和任务举措\\r\\n3.光宽端到端新增六项能力基本完成50%\\r\\n4.参与稽核集团光宽智慧运营数据质量\\r\\n5.配合专线开通工作\\r\\n6.支撑宽带千兆提速工作\", \"1.互联网业务质量综合得分与周边省份可比，指标有所提升。\\r\\n2.完成ITMS系统招标工作。\\r\\n3.光宽端到端新增六项能力基本完成80%\\r\\n4.参与稽核集团光宽智慧运营数据质量，推动数据整改。\\r\\n5.接入网扁平化＞85%\\r\\n6.接入网设备纳管率100%\\r\\n\", \"1.互联网业务质量综合指标，与光端系统打通接口，进行数据关联分析。\\r\\n2.持续天翼网关版本统一工作。\\r\\n3.开始ITMS系统实施工作。\\r\\n4.光宽端到端新增六项能力基本完成90%\\r\\n5.完成光端3.0验收\\r\\n6.配合专线开通相关工作\\r\\n7.开展ITMS零配置工单数据上传工作\\r\\n8.完成PON口分裂自动化工作。\", \"1.互联网业务质量>=95%。\\r\\n2.持续天翼网关版本统一工作，版本统一率达到85%\\r\\n3.ITMS系统建设取得进展。\\r\\n4.光宽端到端新增六项能力基本完成95%\\r\\n5.光端4.0启动\\r\\n6.集约化任务取得进展，基础流程和功能建成。\\r\\n\", \"1.互联网业务质量>=95%。\\r\\n2.持续天翼网关版本统一工作，版本统一率达到88%\\r\\n3.ITMS建设收尾实施工作。\\r\\n4.光宽端到端新增六项能力基本完成100%\\r\\n5.光端4.0建设\\r\\n6.集约化任务取得进展，基础流程和功能建成。\\r\\n\", \"1.互联网业务质量>=95%。；\\r\\n2.持续天翼网关版本统一工作，版本统一率达到88%\\r\\n4.完成ITMS系统工作。\\r\\n5.光网质量提升各项任务基本完成\\r\\n7.光端4.0基本建成\\r\\n8.集约化达标\", \"1.互联网业务质量>=95%。\\r\\n2.持续天翼网关统一工作，版本统一率达到90%\\r\\n3.家庭网关零配置业务开通成功率≥97%\\r\\n4.迎接集约化检查。\\r\\n5.迎接双提升检查\", \"1.互联网业务质量>=95%。\\r\\n2.各项工作收尾\\r\\n3.巩固集约化和光端4.0工作成效\\r\\n4.光端客户资源树完整率≥99%\", \"1.互联网业务质量>=95%。\\r\\n2.光端客户资源树完整率≥99%\\r\\n3.工作盘点与下年度工作谋划\" ],\r\n  \"targetScore\" : [ \"10\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\" ],\r\n  \"file\" : [ \"undefined