INSERT INTO `sys_oper_log` VALUES ('888', '工作任务', '2', 'com.ruoyi.web.controller.worktask.WorkTaskController.editSave()', '1', 'admin', '研发部门', '/worktask/workTask/edit', '127.0.0.1', '内网IP', '{\r\n  \"id\" : [ \"eb29a3a280a945c5a3a583654c8d4a4f\" ],\r\n  \"pid\" : [ \"0\" ],\r\n  \"workName\" : [ \"天翼高清端到端运营能力提升\" ],\r\n  \"rateProgress\" : [ \"0\" ],\r\n  \"leadDeptName\" : [ \"宽带与视频运营部\" ],\r\n  \"leadDeptId\" : [ \"115\" ],\r\n  \"cooperateDeptName\" : [ \"承载网络运营部\" ],\r\n  \"cooperateDeptId\" : [ \"117\" ],\r\n  \"workScore\" : [ \"\" ],\r\n  \"workType\" : [ \"1\" ],\r\n  \"description\" : [ \"支撑省公司、分公司电视业务“高质量”发展，在直播、点播两大基础上，扩展业务生态圈结构，以智能化、精准化、便捷化、效率化为目标，从业务、平台、承载网络、终端四位一体开展优化提升，持续巩固电视业务质量和口碑。\\r\\n1、（天翼高清感知优良率≥95%（忙时）、直播切换1s内成功率≥95%；点播3s内加载成功率≥95%；开机认证成功率≥99%\\r\\n2、主流智能机顶盒版本统一率≥90%；\\r\\n3、增量部署集团探针，使总规模达到60万以上\\r\\n4、支撑智慧家庭应用推广和天翼高清内容运营，创新应用和内容，提升业务吸引力。\" ],\r\n  \"openQuestion\" : [ \"\" ],\r\n  \"remark\" : [ \"\" ],\r\n  \"userIds\" : [ \"\" ],\r\n  \"leaderId\" : [ \"315\" ],\r\n  \"file\" : [ \"undefined\" ]\r\n}', '0', null, '2019-03-28 00:16:13');
