INSERT INTO `work_task` VALUES ('d0f0a8c3044145dda2259fb45ebe8878', '0', '光网质量提升2.0--- 构建高质量智能连接', '0', '打造高速率精品光网，奠定智能宽带基础，确保客户感知更优及能力行业绝对领先；\r\n强化端到端承载能力，深化家庭连接智慧化，提升智能宽带体验。\r\n重点工作目标值：\r\n1、直连和经一级级联至BAS的OLT占比≥95%；\r\n2、2000户以上OLT、汇聚交换机双物理上联完成率100%；\r\n3、OLT超限链路占比≤2%；\r\n4、存量用户光衰达标率≥98%，新装用户光衰达标率100%；\r\n5、OLT设备月度脱网率≤2%；\r\n6、接入网现场资源准确率≥95%；\r\n7、天翼网关存量终端匹配率≥95%，新装终端匹配率100%；\r\n8、互联网业务质量综合得分≥95分；\r\n9、宽带接入速率感知优良率≥92%；\r\n10、天翼网关主流终端软件版本统一率≥90%；\r\n11、光端客户资源树完整率≥99%；   ', null, null, null, '111', '1', '2', null, '1', 'admin', '2019-03-27 11:42:02', 'admin', '2019-03-31 12:37:21', '0', '234', '0', null, '112', '117', '315');
INSERT INTO `work_task` VALUES ('eb29a3a280a945c5a3a583654c8d4a4f', '0', '天翼高清端到端运营能力提升', '0', '支撑省公司、分公司电视业务“高质量”发展，在直播、点播两大基础上，扩展业务生态圈结构，以智能化、精准化、便捷化、效率化为目标，从业务、平台、承载网络、终端四位一体开展优化提升，持续巩固电视业务质量和口碑。\r\n1、（天翼高清感知优良率≥95%（忙时）、直播切换1s内成功率≥95%；点播3s内加载成功率≥95%；开机认证成功率≥99%\r\n2、主流智能机顶盒版本统一率≥90%；\r\n3、增量部署集团探针，使总规模达到60万以上\r\n4、支撑智慧家庭应用推广和天翼高清内容运营，创新应用和内容，提升业务吸引力。', null, null, null, null, '1', '2', null, '1', 'admin', '2019-03-27 11:44:21', 'admin', '2019-03-28 09:49:09', '0', null, '0', null, '115', '116,117', '315');
