-- ----------------------------
-- Table structure for work_task
-- ----------------------------
DROP TABLE IF EXISTS `work_task`;
CREATE TABLE `work_task` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `pid` varchar(64) DEFAULT NULL COMMENT '上级任务的id',
  `work_name` varchar(255) DEFAULT NULL COMMENT '工作任务名称',
  `rate_progress` int(11) DEFAULT '0' COMMENT '进度',
  `description` varchar(2000) DEFAULT NULL COMMENT '任务描述',
  `begin_time` datetime DEFAULT NULL COMMENT '任务开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '任务结束时间',
  `user_ids` varchar(255) DEFAULT NULL COMMENT '执行人',
  `open_question` varchar(255) DEFAULT NULL COMMENT '存在的问题',
  `work_type` char(255) DEFAULT NULL COMMENT '1重点工作 2班组 3个人任务',
  `result` char(255) DEFAULT '2' COMMENT '1红灯2绿灯 3黄灯',
  `work_time` int(11) DEFAULT NULL COMMENT '任务完成工时',
  `work_status` char(255) DEFAULT '1' COMMENT '1进行中 2已完成 3 已归档',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(255) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(255) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）,默认0',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `ancestors` varchar(50) DEFAULT '' COMMENT '祖级列表',
  `work_score` double DEFAULT NULL COMMENT '评分',
  `lead_dept_id` int(11) DEFAULT NULL COMMENT '牵头部门',
  `cooperate_dept_id` varchar(11) DEFAULT NULL COMMENT '配合部门',
  `leader_id` varchar(255) DEFAULT NULL COMMENT '分管领导',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='工作任务';

-- ----------------------------
-- Records of work_task
-- ----------------------------

-- ----------------------------
-- Table structure for work_task_activity
-- ----------------------------
DROP TABLE IF EXISTS `work_task_activity`;
CREATE TABLE `work_task_activity` (
  `id` varchar(128) NOT NULL COMMENT '主键',
  `work_task_id` varchar(128) DEFAULT NULL COMMENT '任务的id',
  `content` varchar(255) DEFAULT NULL COMMENT '汇报内容',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(255) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(255) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）,默认0',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `rep_content` varchar(255) DEFAULT NULL COMMENT '存在问题内容',
  `target` varchar(2000) DEFAULT NULL COMMENT '目标',
  `target_score` double DEFAULT NULL COMMENT '目标得分',
  `target_month` varchar(255) DEFAULT NULL COMMENT '目标月份',
  `work_status` char(255) DEFAULT '1' COMMENT '任务状态 1进行中 2已完成',
  `order_num` int(4) DEFAULT '0' COMMENT '显示顺序',
  `process_instance_id` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='专项工作汇报内容';

-- ----------------------------
-- Records of work_task_activity
-- ----------------------------

-- ----------------------------
-- Table structure for work_task_file
-- ----------------------------
DROP TABLE IF EXISTS `work_task_file`;
CREATE TABLE `work_task_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `work_task_id` varchar(64) DEFAULT NULL COMMENT '任务的id',
  `file_path` varchar(2000) DEFAULT NULL COMMENT '附件路径',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(255) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(255) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）,默认0',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `file_name` varchar(100) DEFAULT NULL COMMENT '文件名',
  `extension` varchar(255) DEFAULT NULL COMMENT '扩展名',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='附件';

-- ----------------------------
-- Records of work_task_file
-- ----------------------------
